// frontend/src/pages/MatchDetailPage.js
import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import { getMatchById } from "../api";

function MatchDetailPage() {
  const { matchId } = useParams();
  const [match, setMatch] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchMatch = async () => {
      setLoading(true);
      const data = await getMatchById(matchId);
      setMatch(data);
      setLoading(false);
    };
    fetchMatch();
  }, [matchId]);

  const formatDateTime = (utcDateString, localMatchTimeString) => {
    /* ... */
  };
  const getWinnerText = (winner) => {
    /* ... */
  };
  const sidebarStickyTop = "top-16";
  const sidebarMaxHeight = "max-h-[calc(100vh_-_4rem_-_theme(spacing.8))]";
  const getPredictionOutcomeDetails = (outcomeCode) => {
    /* ... */
  };
  const recommendedOutcomeDetails = match?.Predicted_Outcome
    ? getPredictionOutcomeDetails(match.Predicted_Outcome)
    : null; // Используем опциональную цепочку здесь

  if (loading) {
    /* ... */
  }
  if (!match) {
    /* ... */
  }

  return (
    <div className="flex flex-col lg:flex-row gap-6 lg:gap-8">
      <section className="w-full lg:flex-grow min-w-0">
        {/* Блок с логотипами, названиями команд и VS */}
        <div className="bg-brand-surface rounded-lg shadow-lg p-6 md:p-8 mb-6 text-center">
          {/* ... */}
        </div>

        {/* Блок с результатами (если матч завершен) */}
        {match.status === "FINISHED" && (
          <div className="bg-brand-surface rounded-lg shadow-lg p-6 md:p-8 mb-6 text-center">
            {/* ... */}
          </div>
        )}

        {/* Блок с вероятностями прогнозов */}
        {match.Predicted_Outcome &&
          match.Prob_H !== null &&
          match.Prob_D !== null &&
          match.Prob_A !== null && (
            <div className="bg-brand-surface rounded-lg shadow-lg p-6 md:p-8 mb-6 relative overflow-hidden">
              <div className="absolute top-0 left-0 w-1 h-full bg-gradient-to-b from-transparent via-brand-primary-red to-transparent opacity-75"></div>
              <div className="pl-3">
                {/* Заголовок "Прогноз и Вероятности" - ДОБАВЛЕНО text-center */}
                <h3 className="text-xl font-bold text-brand-primary-yellow mb-6 text-center">
                  Прогноз и Вероятности
                </h3>

                {/* Единая полоса прогресса */}
                {/* ... */}

                {/* Подписи с процентами */}
                {/* ... */}

                {/* Рекомендуемый исход */}
                <p className="text-center text-lg font-bold mt-10">
                  <span className="text-brand-text-light">
                    Рекомендуемый исход:{" "}
                  </span>
                  <span className={recommendedOutcomeDetails?.colorClass}>
                    {" "}
                    {/* Добавлена опциональная цепочка */}
                    {recommendedOutcomeDetails?.text}{" "}
                    {/* Добавлена опциональная цепочка */}
                  </span>
                </p>
              </div>
            </div>
          )}

        {/* Заглушка для блока "Последние матчи" - ДОБАВЛЕНО text-center */}
        <div className="bg-brand-surface rounded-lg shadow-lg p-6 md:p-8 text-center">
          {/* Заголовок "Последние матчи команд" - ДОБАВЛЕНО text-center */}
          <h3 className="text-xl font-bold text-brand-primary-yellow mb-3 text-center">
            Последние матчи команд
          </h3>
          {/* Текст заглушки - ДОБАВЛЕНО text-center */}
          <p className="text-brand-text-muted text-center">
            Здесь будет информация о последних матчах {match.homeTeam_name} и{" "}
            {match.awayTeam_name}.
          </p>
          <p className="text-sm text-brand-text-muted mt-2 text-center">
            (Данные пока недоступны.)
          </p>
        </div>
      </section>

      {/* Правый сайдбар для турнирной таблицы (заглушка) */}
      <aside
        className={`w-full lg:w-72 xl:w-80 flex-shrink-0 hidden md:block lg:sticky ${sidebarStickyTop} self-start ${sidebarMaxHeight} overflow-y-auto rounded-lg`}
      >
        <div className="bg-brand-surface p-4 rounded-lg shadow-md min-h-[300px] flex flex-col">
          <h3 className="text-xl font-semibold mb-3 text-brand-primary-yellow">
            Турнирная таблица
          </h3>
          <p className="text-brand-text-muted flex-grow flex items-center justify-center text-center">
            Таблица для {match.competition_name || "выбранной лиги"}
          </p>
        </div>
      </aside>
    </div>
  );
}

export default MatchDetailPage;
